const Counter = () => {
    return (
        <div>
            <div className='card'>

                <div className='card bg-secondary px-5 py-4'>
                    <h2>My counter App</h2>
                </div>
                <div className='card-body bg-light'>
                    <p>My card body</p>
                    <button className='btn bg-primary text-light m-3 '>Increase</button>
                    <button className='btn bg-danger text-light'>Increase</button>
                </div>
            </div>
        </div>
    );
};

export default Counter;
